import React, { useState } from "react";

const MyTodoList = () => {
  const [todos, setTodos] = useState([
    {
      id: 1,
      title: "Java Script 공부하기",
      body: "혼공스 마스터하기",
      isDone: false,
    },
    {
      id: 2,
      title: "운동하기",
      body: "9시부터 10시까지 빡시게 운동",
      isDone: false,
    },
  ]);

  return (
    <Layout>
      <Form setTodos={setTodos} todos={todos} />
      <List todos={todos} setTodos={setTodos} />
    </Layout>
  );
};
export default MyTodoList;
